  const [isRegistrated, setIsRegistrated] = useState<boolean>(false);
  return (
    <div className="bottom">
      <Registration isRegistrated={isRegistrated} />
      {isRegistrated && <UserList />}
    </div>
  );
};

export default BottomContent;
